import React from "react";
import styled from "@emotion/styled";
const SearchIconWrapper = props => {

    return (
        function styled(div) {
            return (({ theme }) => ({
                padding: theme.spacing(0, 2),
                height: '100%',
                position: 'absolute',
                pointerEvents: 'none',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center'
            }));
        })
};
export default SearchIconWrapper;
